import React, { useState } from "react";
import styles from "./gatePass.module.css"; // Importing CSS module
// Assuming your CSS file is named gatePass.module.css

function ExitDetailsForm() {
  const [formData, setFormData] = useState({
    name: "",
    mobileNumber: "",
    programEnrolled: "",
    enrollmentYear: "",
    timeOfExit: "",
    dateOfExit: "",
    dateOfReturn: "",
    timeOfReturn: "",
    purposeOfExit: "",
  });

  const handleChange = (event) => {
    setFormData({ ...formData, [event.target.name]: event.target.value });
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Submit form data here
    console.log(formData);
  };

  return (
    <div className={styles["exit-details-form1"]}>
      <div className={styles["heading"]}>
        <h1>Exit Details Form</h1>
      </div>
      <form onSubmit={handleSubmit}>
        {/* Section 1: Personal Details and Enrollment Details */}
        <div className={styles["formDiv"]}>
          <div className={styles["section1"]}>
            <h2>Student Information</h2>
            <div className={styles["form-group"]}>
              <label htmlFor="name">Name</label>
              <input
                type="text"
                name="name"
                id="name"
                value={formData.name}
                onChange={handleChange}
                required
              />
            </div>
            {/* Other form fields... */}
          </div>
          {/* Section 2: Exit Details */}
          <div className={styles["section2"]}>
            <h2>Exit Information</h2>
            <div className={styles["form-group"]}>
              <label htmlFor="timeOfExit">Time of Exit</label>
              <input
                type="time"
                name="timeOfExit"
                id="timeOfExit"
                value={formData.timeOfExit}
                onChange={handleChange}
                required
              />
            </div>
            {/* Other form fields... */}
          </div>
        </div>
        {/* Section 3: Purpose of Exit and Submit Button */}
        <div className={styles["section3"]}>
          <div className={styles["form-group"]}>
            <label htmlFor="purposeOfExit">Purpose of Exit</label>
            <textarea
              name="purposeOfExit"
              id="purposeOfExit"
              value={formData.purposeOfExit}
              onChange={handleChange}
              required
            />
          </div>
          <button type="submit" className={styles["submitButton"]}>
            Submit Form
          </button>
        </div>
      </form>
    </div>
  );
}

export default ExitDetailsForm;
